'SELECT ',
'    v.NAME AS "Vehicle", ',
'    b.START_LOCATION AS "Start Location",',
'    b.END_LOCATION AS "End Location", ',
'    TO_CHAR(b.START_DATE, ''DD-MON-YYYY HH24:MI'') AS "Start Date", ',
'    TO_CHAR(b.END_DATE, ''DD-MON-YYYY HH24:MI'') AS "End Date", ',
'    d.NAME AS "Deposit Type", ',
'    COALESCE(ebx.EQUIPMENT_LIST, ''No Extras'') AS "Extras",  ',
'    b.TOTAL_PRICE AS "Total Price"',
'FROM ',
'    EFR_BOOKINGS b',
'JOIN ',
'    EFR_VEHICLES v ON b.VEHICLE_ID = v.ID',
'JOIN ',
'    EFR_DEPOSITS d ON b.DEPOSIT_TYPE = d.ID',
'LEFT JOIN (',
'    SELECT ',
'        be.BOOKING_ID, ',
'        LISTAGG(e.NAME, '', '') WITHIN GROUP (ORDER BY e.NAME) AS EQUIPMENT_LIST',
'    FROM ',
'        EFR_BOOKING_EXTRAS be',
'    JOIN ',
'        EFR_EXTRAS e ON e.ID = be.EXTRA_ID',
'    GROUP BY ',
'        be.BOOKING_ID',
