wwv_flow_imp_page.create_page_item(
 p_id=>wwv_flow_imp.id(65661496733114410013)
,p_name=>'P5_TOTAL_PRICE'
,p_item_sequence=>100
,p_item_plug_id=>wwv_flow_imp.id(65796197974391215835)
,p_use_cache_before_default=>'NO'
,p_prompt=>'TOTAL'
,p_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'  v_pickup_date DATE;',
'  v_return_date DATE;',
'  v_duration NUMBER;',
'  v_price_per_day NUMBER;',
'  v_deposit_factor NUMBER;',
'  v_total_extras NUMBER := 0;',
'BEGIN',
'  -- Convert VARCHAR2 to DATE',
'  v_pickup_date := TO_DATE(:P5_PICKUP_DATE, ''DD-MON-YYYY HH24:MI'');',
'  v_return_date := TO_DATE(:P5_RETURN_DATE, ''DD-MON-YYYY HH24:MI'');',
'',
'  -- Calculate the duration in days: Fractional days should be charged as full days',
'  v_duration := CEIL((v_return_date - v_pickup_date) * 24 / 24);',
'',
'  -- Fetch the price per day for the selected vehicle',
'  SELECT PRICE_PER_DAY',
'  INTO v_price_per_day',
'  FROM EFR_VEHICLES',
'  WHERE ID = TO_NUMBER(:P0_VEHICLE);',
'  ',
'  -- Fetch the multiplier for the selected deposit option',
'  SELECT PRICE_FACTOR',
'  INTO v_deposit_factor',
'  FROM EFR_DEPOSITS',
'  WHERE ID = TO_NUMBER(:P0_DEPOSIT);',
'',
'  -- Calculate total price for the checked extras (price per day * duration)',
'  FOR rec IN (',
'    SELECT PRICE_PER_DAY',
'    FROM EFR_EXTRAS',
'    WHERE ID IN (SELECT COLUMN_VALUE FROM TABLE(APEX_STRING.SPLIT(TO_CHAR(:P5_EQUIPMENT), '','')))',
'  ) LOOP',
'    v_total_extras := v_total_extras + (rec.PRICE_PER_DAY * v_duration);',
'  END LOOP;',
'',
'  -- Compute the total price including vehicle, deposit, and extras',
unistr('  RETURN ''\20AC'' || TO_CHAR(v_duration * v_price_per_day * v_deposit_factor + NVL(v_total_extras, 0), ''9990.00'');'),
'EXCEPTION',
'  WHEN OTHERS THEN',
'    RETURN ''Error: '' || SQLERRM;',
'END;'))
,p_source_type=>'FUNCTION_BODY'
,p_source_language=>'PLSQL'
,p_display_as=>'NATIVE_DISPLAY_ONLY'
