,p_name=>'Insert Booking and Payment'
,p_action=>'NATIVE_EXECUTE_PLSQL_CODE'
,p_attribute_01=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    v_start_location VARCHAR2(255);',
'    v_end_location VARCHAR2(255);',
'    v_start_date TIMESTAMP; ',
'    v_end_date TIMESTAMP;   ',
'    v_deposit_type NUMBER;',
'    v_total_price NUMBER;',
'    v_booking_id NUMBER; -- Variable to store the inserted booking ID',
'    v_token VARCHAR2(64); -- Store hashed card number',
'BEGIN',
'    -- Get start and end locations',
'    v_start_location := :P5_PICKUP_LOCATION;',
'    v_end_location := :P5_RETURN_LOCATION;',
'',
'    -- Convert dates to TIMESTAMP',
'    v_start_date := TO_TIMESTAMP(:P5_PICKUP_DATE, ''DD-MON-YYYY HH24:MI'');',
'    v_end_date := TO_TIMESTAMP(:P5_RETURN_DATE, ''DD-MON-YYYY HH24:MI''); ',
'    ',
'    -- Get the selected deposit type',
'    v_deposit_type := :P0_DEPOSIT;',
'',
'    -- Convert total price',
unistr('    v_total_price := TO_NUMBER(REPLACE(:P5_TOTAL_PRICE, ''\20AC'', ''''), ''9990.99'');'),
'',
'    -- Hash the card number securely using STANDARD_HASH (SHA256)',
'    -- Compute the token using SQL',
'    SELECT STANDARD_HASH(:P5_CARD_NUMBER, ''SHA256'')',
'    INTO v_token',
'    FROM dual;',
'',
'    -- Insert the booking ',
'    INSERT INTO EFR_BOOKINGS (',
'        USER_ID,',
'        VEHICLE_ID,',
'        START_LOCATION,',
'        END_LOCATION,',
'        START_DATE,',
'        END_DATE,',
'        DEPOSIT_TYPE,',
'        TOTAL_PRICE',
'    ) ',
'    VALUES (',
'        :APP_USER,               ',
'        :P0_VEHICLE,             ',
'        v_start_location,        ',
'        v_end_location,          ',
'        v_start_date,           ',
'        v_end_date,           ',
'        v_deposit_type,          ',
'        v_total_price            ',
'    )',
'    RETURNING ID INTO v_booking_id; -- Capture the last inserted booking ID',
'',
'    -- Insert the selected extras into the EFR_BOOKING_EXTRAS table',
'    FOR i IN (SELECT COLUMN_VALUE AS EXTRA_ID',
'              FROM TABLE(APEX_STRING.SPLIT(TO_CHAR(:P5_EQUIPMENT), '':''))) ',
'    LOOP',
'        -- Ensure each value is numeric before inserting',
'        IF NOT REGEXP_LIKE(i.EXTRA_ID, ''^\d+$'') THEN',
'            RAISE_APPLICATION_ERROR(-20002, ''Invalid extra ID: '' || i.EXTRA_ID);',
'        END IF;',
'',
'        INSERT INTO EFR_BOOKING_EXTRAS (',
'            BOOKING_ID,',
'            EXTRA_ID',
'        )',
'        VALUES (',
'            v_booking_id,  ',
'            i.EXTRA_ID',
'        );',
'    END LOOP;',
'',
'    -- Insert the payment record',
'    INSERT INTO EFR_PAYMENTS (',
'        BOOKING_ID,',
'        CARD_HASH,',
'        PAYMENT_DATE,',
'        AMOUNT',
'    ) VALUES (',
'        v_booking_id,           -- Use the booking ID inserted above',
'        v_token,                -- Tokenized card hash',
'        SYSTIMESTAMP,           -- Current timestamp for payment',
'        v_total_price           -- Total price from the booking',
'    );',
'',
'    COMMIT;',
'END;',
''))
,p_attribute_02=>'P5_PICKUP_LOCATION,P5_RETURN_LOCATION,P5_PICKUP_DATE,P5_RETURN_DATE,P5_DEPOSIT,P5_EQUIPMENT,P5_TOTAL_PRICE,P5_CARD_NUMBER,P5_EXPIRATION_DATE,P5_CVV'
,p_attribute_05=>'PLSQL'
,p_wait_for_result=>'Y'
);
