begin
wwv_flow_imp_page.create_page(
 p_id=>9000
,p_name=>'Administration'
,p_alias=>'ADMINISTRATION'
,p_step_title=>'Administration'
,p_autocomplete_on_off=>'OFF'
,p_javascript_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'let moveMarkerInterval;',
'',
'function moveMarker() {',
'',
'    console.log("Marker ID:", $v("P9000_VEHICLE_ID"));',
'    console.log("Current Latitude:", $v("P9000_CURRENT_LAT"));',
'    console.log("Current Longitude:", $v("P9000_CURRENT_LNG"));',
'    ',
'    let currentLat = parseFloat($v("P9000_CURRENT_LAT"));',
'    let currentLng = parseFloat($v("P9000_CURRENT_LNG"));',
'    let destLat = parseFloat($v("P9000_DEST_LAT"));',
'    let destLng = parseFloat($v("P9000_DEST_LNG"));',
'    ',
'    const incrementStep = 0.00125; // For a speed of 100 km/h',
'',
'    let deltaLat = destLat - currentLat;',
'    let deltaLng = destLng - currentLng;',
'',
'    if (Math.abs(deltaLat) < incrementStep && Math.abs(deltaLng) < incrementStep) {',
'        clearInterval(moveMarkerInterval);',
'        console.log("Destination reached.");',
'    } else {',
'        currentLat += Math.sign(deltaLat) * incrementStep;',
'        currentLng += Math.sign(deltaLng) * incrementStep;',
'',
'        // Update page items',
'        apex.item("P9000_CURRENT_LAT").setValue(currentLat);',
'        apex.item("P9000_CURRENT_LNG").setValue(currentLng);',
'',
'        // Call the AJAX Callback Process',
'        apex.server.process(',
'            ''UPDATE_MARKER_POSITION'',',
'            {',
'                x01: currentLat,',
'                x02: currentLng,',
'                x03: $v("P9000_VEHICLE_ID")',
'            },',
'            {',
'                success: function() {',
'                    // console.log("Marker position updated successfully!");',
'                    apex.region("map_region_id").refresh();',
'                },',
'                error: function(error) {',
'                    // console.error("Error updating marker position:", error);',
'                    apex.region("map_region_id").refresh();',
'                }',
'            }',
'        );',
'    }',
'}',
'',
'function startMovingMarker() {',
'    if (!moveMarkerInterval) {',
'        moveMarkerInterval = setInterval(moveMarker, 5000); // Update every 5 seconds',
'        console.log("Moving marker towards destination...");',
'    }',
'}',
'',
'function stopMovingMarker() {',
'    if (moveMarkerInterval) {',
'        clearInterval(moveMarkerInterval);',
'        moveMarkerInterval = null;',
'        console.log("Marker movement stopped.");',
'    }',
'}',
'',
'document.getElementById("startButton").addEventListener("click", startMovingMarker);',
'document.getElementById("stopButton").addEventListener("click", stopMovingMarker);'))
