'    v_vehicle_id NUMBER := TO_NUMBER(apex_application.g_x03);',
'BEGIN',
'',
'    IF (v_latitude IS NOT NULL AND v_longitude IS NOT NULL) THEN',
'        UPDATE EFR_TRACKERS',
'        SET ',
'            LATITUDE = v_latitude,',
'            LONGITUDE = v_longitude,',
'            TIMESTAMP = SYSTIMESTAMP',
'        WHERE VEHICLE_ID = v_vehicle_id;',
'',
'        COMMIT;',
'    ELSE',
'        RAISE_APPLICATION_ERROR(-20001, ''Invalid coordinates provided.'');',
'    END IF;',
'END;'))
,p_process_clob_language=>'PLSQL'
